    false,nt"url": null,nt"notes": "The focus of the project was to inventory
    and map the natural communities and significant ecological resources of the study
    area, and to develop a long-term resource management plan for Crown Vantage lands
    that integrates silvicultural goals and needs with the conservation of wildlife
    habitat and other important ecological resources. The primary goals of this plan
    are to: 1) create and maintain balanced size-class distributions within each natural
    community to provide both a sustainable flow of timber products and a diversity
    of forest habitats, and 2) provide a high level of protection to aquatic and wetland
    habitats, uncommon natural communities, rare plants, and critical habitat features.",nt"license_title":
